import { useDispatch, useSelector } from 'react-redux'
import { Row, Col } from 'reactstrap';
import UserTable from './Table';
import { MDBDataTable } from 'mdbreact';
import './style.css';
import { usersTableHead } from '../../common';
import { getUsersLists } from '../../store/reducers/users/action';

const UserComponent = ({props}) => {
    const dispatch = useDispatch();
    const userState = useSelector(state => {return state.users.usersList});
    console.log(">>>>>>>>>>>>>"+useState);
    const [usersList, setusersList] = useState({
        columns: [...usersTableHead],
        rows: []
    });

    useEffect(() => {
        dispatch(getUsersLists())
    }, [])

    return (
        <div>
            <Row>
                <Col>
                    <p className="page-head">Users &nbsp; Page</p>                    
                </Col>
            </Row>
            <Row>
                <Col>
                    {/* <UserTable tableBody={usersList} tableHead={} /> */}
                    <MDBDataTable striped bordered small data={usersList} className="table-responsive" />
                </Col>
            </Row>
        </div>
    )
}

export default UserComponent
